import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity } from 'react-native';
import IncomeCard
    from '../../../components/composite/Dashboard/landlord/incomeCard';
const Dashboard = () => {
    return (
        <View style={styles.container}>
            <IncomeCard monthlyIncome={12345} incomeData={[12000, 12300, 12500, 12700, 12900, 12345]}/>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        padding: 20,
        backgroundColor: '#f5f5f5', // light grey background
    },
    quickStatsContainer: {
        marginVertical: 20,
    },
    tilesContainer: {
        flexDirection: 'row',
        flexWrap: 'wrap',
        justifyContent: 'space-between',
    },
    tile: {
        width: '48%', // roughly half, considering the space between
        height: 120,
        backgroundColor: '#007BFF',
        borderRadius: 10,
        alignItems: 'center',
        justifyContent: 'center',
        marginBottom: 10,
    },
    tileText: {
        color: 'white',
        fontSize: 16,
        textAlign: 'center',
    },
    calendarContainer: {
        marginTop: 20,
    },
    searchContainer: {
        marginTop: 20,
    },
});

export default Dashboard;
